import React from 'react'


export default class Textinput extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            checked: 'false'
        }
    }



    render() {
        return (
            <div>
                    <br></br>                
                    <label>Answer: </label>
                    {<input type="text" nameonChange={this.props.onChange} />}                
            </div>
        )
    }
}
